-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user`  (
  `id` int(12) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '必须唯一',
  `username` varchar(12) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '必须唯一',
  `password` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '必须且经过加密',
  `salt` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'md5加密salt',
  `age` tinyint(3) UNSIGNED NULL DEFAULT 0 COMMENT '默认为0',
  `gender` tinyint(1) NULL DEFAULT 0 COMMENT '0代表男,1代表女,2代表性别未知,默认为2',
  `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '必须且唯一，用于找回密码',
  `phone` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '默认为00000000000',
  `head_picture` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  `register_time` datetime(0) NOT NULL,
  `last_login_time` datetime(0) NOT NULL,
  `status` tinyint(1) NOT NULL COMMENT 'o代表可以用户有效,1代表用户被禁用',
  `role` tinyint(1) NOT NULL COMMENT '0代表普通用户,1代表管理员',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `unique_index_email`(`email`) USING BTREE COMMENT 'email必须唯一',
  UNIQUE INDEX `unique_index_username`(`username`) USING BTREE COMMENT 'username必须唯一'
) ENGINE = InnoDB AUTO_INCREMENT = 55 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

